word3279=<div class="mat-content"><div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight:bold;">Car2CN</span>automobile financial supply chain service use innovative ways to combine purchase order finance and credit insurance protection to create a powerful financial solution for the automobile exporters. The solution we provided free up cash flow and enable exporters to grow at a faster rate.</div><div style="margin-top:30px;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Our automobile financial supply chain services cover the major markets such as USA, Mexico, Canada, and European Countries, etc. Because of the excellent trading relationship that Car2cn maintains with the importers and exporters around the world and effectively mitigate the risk, the competitive rate Car2cn provided is substantial lower than  the traditional financial service providers. The custom  solution allows exporters to fulfill more orders and ultimately make more sales once the capital is freed up. At the end, companies can exponentially improve their profits.</div><p class="boldTitle">The business process:</p><div style="line-height:35px;"><img src="/resources/details/img/lct.png" alt="" style="display: block;margin: 10px auto;"><div><span style="font-weight:bold;">1.&nbsp;&nbsp;</span>Buyer sends Purchase Order to Sellers   </br><span style="font-weight:bold;">2.&nbsp;&nbsp;</span>Seller delivers the vehicle and related documents to the designated warehouse. </br><span style="font-weight:bold;">3.&nbsp;&nbsp;</span> Buyer provide Letter of Credit receipt to <span style="font-weight:bold;">Car2CN</span></br><span style="font-weight:bold;">4.&nbsp;&nbsp;</span><span style="font-weight:bold;">Car2CN</span>release the fund to Seller Once L/C, automobile, and documents are received by the platform.</br><span style="font-weight:bold;">5.&nbsp;&nbsp;</span>Vehicle is being shipped to Buyer </br><span style="font-weight:bold;">6.&nbsp;&nbsp;</span>Car2cn calculate and closes the balance when the L/C payment is received.</div></div><p class="boldTitle">The pain points of auto exporters:</p><div><div><div> <p><span style="font-weight:bold;">1.&nbsp;&nbsp;</span>Letter of Credit</p> <div style="margin: 20px 0;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Most of the banks in the U.S don't provide Letter of Credit services to auto exporters, which limited the sales that the seller can make.</div></div><div style="margin: 20px 0;"><p><span style="font-weight:bold;">2.&nbsp;&nbsp;</span>Cash Flow</p><div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Provide solution to cash flow problem, exponentially increase the sales revenue for the sellers.</div></div></div></div><div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight:bold;">Car2CN</span> financial supply chain service deeply understand the pain points of the auto exporters; core members have over 5 years of parallel-import experiences. Our goal is to maximize the profit margin within a short period of time for our valued customers.</div></div>

